import React from "react";
import PropTypes from "prop-types";

const Title = props => {
  return (
    <React.Fragment>
      <span>{props.titleText}</span>
    </React.Fragment>
  );
};

class Home extends React.Component {
  render() {
    return (
      <div className="home">
        <Title titleText="Featured" />
      </div>
    );
  }
}

export default Home;
